import React from 'react';
import Card from './Card'
import items from './items'
import {ListItem, ListItemText, ListItemIcon, IconButton} from '@material-ui/core/';
import RadioButtonUncheckedIcon from '@material-ui/icons/RadioButtonUnchecked';


const IngredientList = items[0].Ingredients.map((Items,i) =>{
    return(
        <ListItem dense ContainerComponent="li">
            <input type="checkbox" id={items[i].id}/>
            <label for="id">
                <ListItemText primary={Items}></ListItemText>
            </label>

        </ListItem>
    );
})


export default IngredientList;
